import React,{useEffect} from 'react';

const Home = () => {


  const callHomePage=async()=>{

    try{
const res= await fetch("/home",{
  method:"GET",
  headers:{
      Accept:"application/json",
      "Content-Type":"application/json"
  },
  credentials:"include"
})
const data = await res.json()
console.log(data)
    }catch(err){
console.log(err);
    }
  }

  useEffect(() => {
    callHomePage()
  }, []);
  return (
    <div>
      <h1>Home</h1>
    </div>
  );
}

export default Home;
